import { BrowserRouter as Router, Routes, Route, Link} from "react-router-dom";
import Home from "./pages/Home"
import Login from "./pages/Login"

function App() {
  return (
    <div>
      <h1>Hello world</h1>
    <Router>
      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="/Login" element={<Login/>} />  
      </Routes>
      <Link>
      </Link>
    </Router>
    </div>

  );
}

export default App;
